import { useParams } from "react-router-dom";
export default function Detail() {
    const { id } = useParams();
    return (
        <div style={{
            position: 'relative',
        }}>
            <h1>SOY DETAIL ID: {id}</h1>
            <div style={{
                left: '50%',
                backgroundColor: 'blue',
                position: 'absolute',
                width:'30em',
                height: '30em',
                transform: 'translate(-50%, -30%)'
            }}>
            </div>
        </div>
    );
};
